import React from "react";
import { Input, Button } from "../../components";

const CreateBlog = () => {
  return (
    <div>
      <p>Content Create Blog Page</p>
      <Input label="Post Title" />
      <p>Upload Image</p>
      <textarea />
      <Button title="Save" />
    </div>
  );
};

export default CreateBlog;
